"Ovu aplikaciju ("aplikacija za TV uživo") pruža društvo iWedia S.A. na temelju jednokratne, neekskluzivne, neprenosive licence bez plaćanja koju nije moguće podlicencirati i koju je moguće opozvati ("licenca za evaluaciju") koja je predviđena za korištenje isključivo za internu evaluaciju i demonstraciju na razdoblje od šest mjeseci od datuma objave aplikacije za TV uživo.

Licenca za evaluaciju odobrava se isključivo u sljedeće svrhe: 

I. Interna evaluacija – ova je licenca predviđena samo za interno korištenje i nije licenca za proizvod, stoga se ne može distribuirati u potpunosti ili u bilo kojem dijelu niti inkorporirati ni u jedan komercijalni proizvod

II. Demonstracija – osim za internu evaluaciju, ova se licenca može koristiti u marketinške svrhe demonstracije trećim stranama. Strogo je zabranjeno upotrebljavati tu licencu na bilo koji način s konkurentima društva iWedia.

Zabranjeno je sljedeće:

I. podlicenciranje, upotreba ili izmjena aplikacije za TV uživo ili izrada bilo kakvih deriviranih djela iz aplikacije za TV uživo, uključujući svu povezanu dokumentaciju;

II. obrnuto kompiliranje, obrnuti inženjering, rastavljanje, promjena formata, određivanje referentne vrijednosti ili drugi način čitanja koda objekta ili izvornog koda ili pokušaja da se učini čitljivim (ili osnovnih ideja, algoritama, strukture ili organizacije) aplikacije za TV uživo, u cijelosti ili djelomično;

III. izmjena aplikacije za TV uživo ili izrada bilo kakvih deriviranih djela na temelju softvera;

IV. posuđivanje, iznajmljivanje, podlicenciranje, davanje sigurnosnog interesa ili bilo koji drugi oblik prijenosa prava u aplikaciji za TV uživo;

V. uklanjanje ili izmjenjivanje bilo kakvih oznaka ili obavijesti o vlasništvu u aplikaciji za TV uživo;

VI. upotreba aplikacije za TV uživo na bilo koji način kojim se krši bilo kakva prava intelektualnog vlasništva ili privatnosti bilo koje treće strane; ili

VII. upotreba aplikacije za TV uživo na bilo koji način kojim se krši bilo koji važeći međunarodni, savezni, državni ili lokalni zakon ili propis.

Sva prava, titula i interes za prava intelektualnog vlasništva i prava vlasništva u pogledu aplikacije za TV uživo i dalje pripadaju društvu iWedia.

"
